import React from "react";
import "App.scss";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import { Home } from "components/Home";
import { SignUp } from "components/forms/SignUp";
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/sign-up">
            <SignUp />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
